export const StyledUl = styled.ul`
	background-color: #ececec;
	list-style-type: none;
	display: flex;
	flex-direction: column;
	row-gap: 1rem;
	margin: 2rem 0;
`
export const StyledLi = <styled className="li"></styled>`
`
